"""# 4. Gradient Descent (15 points)

* Assume we have $𝑓(𝑥,𝑦) = 𝑥^2/29+𝑦^2/64$
* Use gradient descent to find local minima, start at $(8.5,8.6)$
* Make 1000 Iteration.
"""

import numpy as np
import matplotlib.pyplot as plt

def func(x,y):
  return np.power(x,2)/9 + np.power(y,2)/64

x = y = np.arange(-10, 10, 0.005)
X, Y = np.meshgrid(x, y)
Z = func(X, Y)
fig = plt. figure(figsize=(7, 7))
ax = plt.axes (projection='3d' )
ax. plot_surface(X, Y, Z, alpha=0.5)

#Q4
# according to the function above these are the gradients calc
def gradient(x, y):
    df_dx = 2 * x / 9
    df_dy = 2 * y / 64
    return df_dx, df_dy


# Initialize starting point and learning rate (the step size we take in the direction of the gradient)
x_current, y_current = 8.5, 8.6
iterations = 1000
learning_rates = [0.0001, 0.00001, 0.0005, 0.00099, 0.001]

min_function_value = float('inf')
min_point = None

for learning_rate in learning_rates:
    x, y = x_current, y_current
    for i in range(iterations):
        df_dx, df_dy = gradient(x, y)
        x -= learning_rate * df_dx
        y -= learning_rate * df_dy
    function_value = func(x, y)
    print(f"Learning rate: {learning_rate}")
    print("Local minimum point:", (x, y))
    print("Function value at local minimum:", function_value)
    print()
    if function_value < min_function_value:
        min_function_value = function_value
        min_point = (x, y)

print("----------------------------------------------------")
print("The chosen local minimum point with the lowest function value is:", min_point)
